import React, { useEffect } from 'react';
import Layaout from '../../parcials/Layaout';
import CardHeader from '../../../components/CardHeader'
import { getTicketsSystemTransfer } from '../../../functions/ticketFunction';
import Select from 'react-select';
import {
    MDBRow,
    MDBCol,
    MDBInput,
    MDBBtn,
    MDBIcon,
    MDBTooltip
} from 'mdbreact';

const TransferSystemPage = () => {

    useEffect(() => {
        const dataTicketsTransfer = getTicketsSystemTransfer()
    }, []);

    const options = [
        { value: 'chocolate', label: 'Chocolate' },
        { value: 'strawberry', label: 'Strawberry' },
        { value: 'vanilla', label: 'Vanilla' }
      ]

    return (
        <Layaout>
            <br></br>
            <CardHeader title="Tickets">
                <MDBRow style={{ justifyContent: "center", display: "flex" }}>
                    <MDBCol md='2'>
                        <MDBInput label='Upc' type='text' validate />
                    </MDBCol>
                    <MDBCol md='2'>
                        <MDBInput label='Alu' type='text' validate />
                    </MDBCol>
                    <MDBCol md='2'>
                        <MDBInput label='Talla' type='text' validate />
                    </MDBCol>
                    <MDBCol md='2'>
                        <MDBInput label='Factura' type='text' validate />
                    </MDBCol>
                    <MDBCol md='2' style={{marginTop: "26px"}}>
                        <Select
                            defaultValue={options[1]}
                            options={options}
                        />
                    </MDBCol>
                </MDBRow>
                <MDBRow style={{ justifyContent: "center", display: "flex" }}>
                    <MDBTooltip
                      tag="Agregar mas tickets"
                      placement="top"
                    >
                        <MDBBtn color='light-blue'><MDBIcon icon="plus"/> Agregar</MDBBtn>
                    </MDBTooltip>
                    <MDBTooltip
                      tag="Crear ticket"
                      placement="top"
                    >
                        <MDBBtn color='light-green'><MDBIcon icon='ticket-alt'/>  Crear Ticket</MDBBtn>
                    </MDBTooltip>
                </MDBRow>
            </CardHeader>
        </Layaout>
    )
}

export default TransferSystemPage;
